import React from 'react';

const styles = {
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  logo: {
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  ul: {
    listStyleType: 'none',
    display: 'flex',
  },
  li: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  login: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    padding: '30px',
  },
};

const NavBar = () => (
  <nav style={styles.nav}>
    <div style={styles.logo}>Logo</div>
    <ul style={styles.ul}>
      <li style={styles.li}>Home</li>
      <li style={styles.li}>About Us</li>
      <li style={styles.li}>Services</li>
      <li style={styles.li}>Contact</li>
    </ul>
    <div style={styles.login}>Login</div>
  </nav>
);

const Footer = () => (
  <footer style={styles.footer}>
    <div>Contact Us</div>
    <ul>
      <li>Company Name: ABC Corporation</li>
      <li>Email: info@abccorp.com</li>
      <li>Phone: (555) 123-4567</li>
      <li>Address: 123 Main Street, Cityville, State, 12345</li>
    </ul>
    <div>Menu</div>
    <ul>
      <li>Home</li>
      <li>About Us</li>
      <li>Partners</li>
      <li>Clubs</li>
      <li>Contact Us</li>
    </ul>
    <div>Follow us on</div>
    <div>
      <div></div>
      <div></div>
      <div></div>
    </div>
  </footer>
);

const EmptyPage = () => (
  <div>
    <NavBar />
    <Footer />
  </div>
);

export default EmptyPage;
